(function(){this.Sugestao=function(){$.ajaxSetup({type:"POST",dataType:"JSON"}),Sugestao.prototype.criar=function(t){var s=null;return $.ajax({url:"sugestoes/sugestao/criar",async:!1,data:{sugestao:JSON.stringify(t)},success:function(t){s=t},error:function(t,a,u){switch(t.status){case 200:s=u;break;case 500:s=!1}}}),s},Sugestao.prototype.listar=function(t){var s=null;return $.ajax({url:"sugestoes/sugestao/listar",async:!1,data:{status:t},success:function(t){s=t},error:function(t){s=t}}),s}}})();